import React, { Component } from 'react';
import FajtaService from "../service/FajtaService";

class EgyFajtaComponent extends Component {
    constructor(props){
        super(props)

        this.state={
            id:this.props.match.params.id,
            fajta:{}
        }
    }
    componentDidMount(){
        FajtaService.getFajtaById(this.state.id).then(res=>{
            this.setState({fajta: res.data});
        })
    }
    render() {
        return (
            <div>
                {this.state.fajtak.map((fajta) => (
                <div>
                    <h3>View Fajta Details</h3>
                    <div>{fajta.fajtaleiras}</div>
                </div>
                ))}
            </div>
        );
    }
}

export default EgyFajtaComponent;
